window.bookSummaryJSON = "<p>In this revised and updated third edition of <i>Unbeatable Mind</i>, Mark Divine offers his philosophy and methods for developing maximum potential through integrated warrior development. This work was created through trial and error, proving to thousands of clients that they are capable of 20 times more than what they believe. </p> <p>The powerful principles for forging deep character, mental toughness, and an elite team provided in this book are the foundation of the Unbeatable Mind \"working in\" program of Divine's SEALFIT Academies and renowned Kokoro Camp. They are being employed by a growing number of coaches, professors, therapists, doctors, and business professionals worldwide. </p> <p>Commander Divine is a retired Navy SEAL and human performance expert who works with elite military, sport, and corporate teams, SEAL/SOF candidates, and others seeking to maximize their potential, leading to more balanced success and happiness. The training is leading to breakthroughs in all walks of life and cultivating a robust community of practitioners. </p> <p>This book will specifically help you develop: </p> <p></p> <ul> <li>Mental clarity - to make better decisions while under pressure. </li> <li>Concentration - to focus on the mission until victory is assured. </li> <li>Awareness - to be more sensitive to your internal and external radar. </li> <li>Leadership authenticity - to be a heart-centered leader and service-oriented teammate. </li> <li>Intuition - to learn to trust your gut and use mental imagery to your advantage. </li> <li>Offensive \"sheepdog\" mindset - to avoid danger and stay one step ahead of the competition or enemy. </li> <li>Warrior spirit - to deepen your willpower, intention, and connection with your spiritual self. </li> </ul> <p></p>"; 
